import Foundation

/// Embedded resource files.
public enum EmbeddedResource: CaseIterable, Equatable, Hashable {
    // Images
    case notion_marker_png
    case notion_marker_chapter_png
    case notion_marker_to_do_png
    case notion_marker_completed_png
    // Videos
    case marker_video_placeholder_mov
}

extension EmbeddedResource {
    var fileName: String {
        fileNameComponents.name + "." + fileNameComponents.ext
    }
    
    var fileNameComponents: (name: String, ext: String) {
        switch self {
        case .notion_marker_png:
            return ("marker", "png")
        case .notion_marker_chapter_png:
            return ("marker-chapter", "png")
        case .notion_marker_to_do_png:
            return ("marker-to-do", "png")
        case .notion_marker_completed_png:
            return ("marker-completed", "png")
        case .marker_video_placeholder_mov:
            return ("marker-video-placeholder", "mov")
        }
    }
    
    var data: Data? {
        switch self {
        case .notion_marker_png:
            return notion_marker_data
        case .notion_marker_chapter_png:
            return notion_marker_chapter_data
        case .notion_marker_to_do_png:
            return notion_marker_to_do_data
        case .notion_marker_completed_png:
            return notion_marker_completed_data
        case .marker_video_placeholder_mov:
            return marker_video_placeholder_data
        }
    }
    
    /// Check that all module resources are locatable.
    static func validateAll() -> Bool {
        allCases.allSatisfy {
            $0.data != nil
        }
    }
}

// MARK: - File Contents

// Note: This is a workaround. We need to Base64 encode the files themselves
// in order for the CLI executable to build as a standalone file.
// If the files are actual files within this Package and we use .resources []
// in Package.swift, compiling the CLI target will produce a .bundle in addition
// to the executable file and will not embed the resources files in the executable.

private let notion_marker_data = Data(
    base64Encoded:
    ""
)

private let notion_marker_chapter_data = Data(
    base64Encoded:
    ""
)

private let notion_marker_completed_data = Data(
    base64Encoded: ""
)

private let notion_marker_to_do_data = Data(
    base64Encoded: ""
)

private let marker_video_placeholder_data = Data(
    base64Encoded:
    ""
)
